MACI.sol is the core contract of the project, as it provides the base layer for user signups and Polls to be created. The constructor shown below accepts three arguments, a PollFactory contract, a SignUpGatekeeper contract, and an InitialVoiceCreditProxy contract. constructor( PollFactory _pollFactory, SignUpGatekeeper _signUpGatekeeper, InitialVoiceCreditProxy _initialVoiceCreditProxy
) { // Deploy the state AccQueue stateAq = new AccQueueQuinaryBlankSl(STATE_TREE_SUBDEPTH); stateAq.enqueue(BLANK_STATE_LEAF_HASH); pollFactory = _pollFactory; signUpGatekeeper = _signUpGatekeeper; initialVoiceCreditProxy = _initialVoiceCreditProxy; signUpTimestamp = block.timestamp; // Verify linked poseidon libraries require( hash2([uint256(1), uint256(1)]) != 0, "MACI: poseidon hash libraries not linked" );
} Upon deployment, the contract will deploy a new AccQueueQuinaryBlankSl contract using the STATE_TREE_SUBDEPTH. By default, this is defined as uint8 internal constant STATE_TREE_SUBDEPTH = 2;. Should this be changed, it will be necessary to amend the contracts/ts/genEmptyBallotRootsContract.ts file to reflect the change. The first action on this deployed contract, is to enqueue (add) an empty hash (defined as 6769006970205099520508948723718471724660867171122235270773600567925038008762). After this, the contracts will be stored to state, the current time taken and then the contract will perform a simple sanity check to ensure that the Poseidon hash libraries were linked successfully. Once the contract is deployed, the owner (set as the deployer address of MACI), is required to call the init function, which is shown below: function init( VkRegistry _vkRegistry, MessageAqFactory _messageAqFactory, TopupCredit _topupCredit ) public onlyOwner { require(!isInitialised, "MACI: already initialised"); isInitialised = true; vkRegistry = _vkRegistry; messageAqFactory = _messageAqFactory; topupCredit = _topupCredit; // Check that the factory contracts have correct access controls before // allowing any functions in MACI to run (via the afterInit modifier) require( pollFactory.owner() == address(this), "MACI: PollFactory owner incorrectly set" ); // The PollFactory needs to store the MessageAqFactory address pollFactory.setMessageAqFactory(messageAqFactory); // The MessageAQFactory owner must be the PollFactory contract require( messageAqFactory.owner() == address(pollFactory), "MACI: MessageAqFactory owner incorrectly set" ); // The VkRegistry owner must be the owner of this contract require( vkRegistry.owner() == owner(), "MACI: VkRegistry owner incorrectly set" ); emit Init(_vkRegistry, _messageAqFactory);
} This function accepts three arguments: VkRegistry - the contract holding the verifying keys MessageAqFactory - the factory contract for deploying new MessageAq contracts TopupCredit - the contract responsible for topping up voting credits In more details, the init function will check/do the following: That the PollFactory contract's owner has been set to be the MACI contract Set the messageAqFactory contract on the pollFactory contract Check that the owner of the messageAqFactory is the pollFactory contract Confirm that the vkRegistry owner is the same as the MACI owner Finally, it will emit an event. Next, we have the signUp function, which allows users to signUp using a SignUpGatekeeper contract. This contract can use any mean necessary to gatekeep access to MACI's polls. For instance, only wallets with access to a specific ERC721 token can be allowed to sign up. Please note that this function can only be called after the contract is initialized (thanks to the afterInit modifier). This function does the following: checks that the maxium number of signups have not been reached. As of now, this will be $5 ** 10 - 1$ due to circuit limitations. checks that the provided public key is within the allowed boundaries increases the number of signups registers the user using the sign up gatekeeper contract. It is important that whichever gatekeeper is used, it reverts if an user tries to sign up twice. calls the voice credit proxy to retrieve the number of allocated voice credits for the calling account hashes the voice credits alongside the calling address and the current time enqueues this hashed data into the stateAq contract function signUp( PubKey memory _pubKey, bytes memory _signUpGatekeeperData, bytes memory _initialVoiceCreditProxyData
) public afterInit { // The circuits only support up to (5 ** 10 - 1) signups require( numSignUps < STATE_TREE_ARITY**stateTreeDepth, "MACI: maximum number of signups reached" ); require( _pubKey.x < SNARK_SCALAR_FIELD && _pubKey.y < SNARK_SCALAR_FIELD, "MACI: _pubKey values should be less than the snark scalar field" ); // Increment the number of signups numSignUps++; // Register the user via the sign-up gatekeeper. This function should // throw if the user has already registered or if ineligible to do so. signUpGatekeeper.register(msg.sender, _signUpGatekeeperData); // Get the user's voice credit balance. uint256 voiceCreditBalance = initialVoiceCreditProxy.getVoiceCredits( msg.sender, _initialVoiceCreditProxyData ); uint256 timestamp = block.timestamp; // Create a state leaf and enqueue it. uint256 stateLeaf = hashStateLeaf( StateLeaf(_pubKey, voiceCreditBalance, timestamp) ); uint256 stateIndex = stateAq.enqueue(stateLeaf); emit SignUp(stateIndex, _pubKey, voiceCreditBalance, timestamp);
} Once everything has been setup, polls can be deployed using the deployPoll function. This function is not protected by access control, therefore any user can deploy one. It should be noted however, that previous poll should have been closed out first, and this can only be done by the owner of the contract, which is the MACI contract itself. function deployPoll( uint256 _duration, MaxValues memory _maxValues, TreeDepths memory _treeDepths, PubKey memory _coordinatorPubKey
) public afterInit { uint256 pollId = nextPollId; // Increment the poll ID for the next poll nextPollId++; if (pollId > 0) { require( stateAq.treeMerged(), "MACI: previous poll must be completed before using a new instance" ); } // The message batch size and the tally batch size BatchSizes memory batchSizes = BatchSizes( MESSAGE_TREE_ARITY**uint8(_treeDepths.messageTreeSubDepth), STATE_TREE_ARITY**uint8(_treeDepths.intStateTreeDepth), STATE_TREE_ARITY**uint8(_treeDepths.intStateTreeDepth) ); Poll p = pollFactory.deploy( _duration, _maxValues, _treeDepths, batchSizes, _coordinatorPubKey, vkRegistry, this, topupCredit, owner() ); polls[pollId] = p; emit DeployPoll(pollId, address(p), _coordinatorPubKey);
}

