This contract allows users to vote on a Poll. The main functions of the contract are as follows: topup - This function accepts two parameters, a stateIndex, and an amount. It can only be called before the voting deadline. After checking whether the deadline has passed or not, it will validate that the contract has not reached the maximum number of messages, if the checks passes, it will increase the number of messages by 1. It will then try to transfer the amount of topUpCredit tokens. Finally, it will create a new Message object that will be hashed and enqueued in the messageAq contract. This messageAq contract is reserved for this one poll only and will only contain its messages. publishMessage - This function allows anyone to publish a message, and it accepts the message object as well as an ephemeral public key. This key together with the coordinator public key will be used to generate a shared ECDH key that will encrypt the message. Before saving the message, the function will check that the voting deadline has not passed, as well as the max number of messages was not reached. The mergeMaciStateAqSubRoots function can be called by the contract admin after the voting deadline and looks like the following: function mergeMaciStateAqSubRoots(uint256 _numSrQueueOps, uint256 _pollId) public onlyOwner isAfterVotingDeadline { // This function can only be called once per Poll require(!stateAqMerged, ERROR_STATE_AQ_ALREADY_MERGED); if (!extContracts.maci.stateAq().subTreesMerged()) { extContracts.maci.mergeStateAqSubRoots(_numSrQueueOps, _pollId); } emit MergeMaciStateAqSubRoots(_numSrQueueOps); } If the subtrees have not been merged on the MACI contract's stateAq, then it will merge it by calling mergeStateAqSubroots. It accets two parameters: _numSrQueueOps - the number of operations required _pollId - the id of the poll The next function, is presented below: function mergeMaciStateAq(uint256 _pollId) public onlyOwner isAfterVotingDeadline { // This function can only be called once per Poll after the voting // deadline require(!stateAqMerged, ERROR_STATE_AQ_ALREADY_MERGED); stateAqMerged = true; require( extContracts.maci.stateAq().subTreesMerged(), ERROR_STATE_AQ_SUBTREES_NEED_MERGE ); mergedStateRoot = extContracts.maci.mergeStateAq(_pollId); // Set currentSbCommitment uint256[3] memory sb; sb[0] = mergedStateRoot; sb[1] = emptyBallotRoots[treeDepths.voteOptionTreeDepth - 1]; sb[2] = uint256(0); currentSbCommitment = hash3(sb); emit MergeMaciStateAq(mergedStateRoot); } This function only accepts one parameter, and can be called by the owner only, and after the voting deadline. The parameter is the pollId for which we want to perform the operation. This function can only be called once per poll, and it will check that the sub trees have been merged on MACI's AccQueue contract. Finally it will merge the whole AccQueue to generate the state root, and store the current commitment comprised of: the Poseidon hash of the merkle root, an empty ballot root stored in the emptyBallotRoots mapping (shown below), and a zero. emptyBallotRoots[0] = uint256( 6579820437991406069687396372962263845395426835385368878767605633903648955255, );
